import React from "react";
import styled from "styled-components";

const SocialIcon = (props) =>{
    return(<div>

        <Icon href="www.google.com" className={"fab fa-github fa-2x"} />

    </div>)
}

export {SocialIcon}

const Icon = styled.i`

position: relative;
transition: transform 1s;
&:hover {
    transform: translate(0px, -20px);
  }
`;
